import unittest
minSkew = __import__('02_MinimumSkew2')

class MinimumSkewCase(unittest.TestCase):
    test2 = ''

    def test_example1(self):
        genome = 'TAAAGACTGCCGAGAGGCCAACACGAGTGCTAGAACGAGGGGCGTAAACGCGGGTCCGAT'
        expected = [11, 24]
        output = minSkew.MinimumSkew(genome)
        self.assertEqual(output, expected)

    def test_example2(self):
        genome = self.test2
        expected = [89969, 89970, 89971, 90345, 90346]
        output = minSkew.MinimumSkew(genome)
        self.assertEqual(output, expected)

    # check that index is not off
    def test_example3(self):
        genome = 'ACCG'
        expected = [3]
        output = minSkew.MinimumSkew(genome)
        self.assertEqual(output, expected)

    # check whether last symbol would be missing
    def test_example4(self):
        genome = 'ACCC'
        expected = [4]
        output = minSkew.MinimumSkew(genome)
        self.assertEqual(output, expected)

    # check whether maximum is returned by accident
    def test_example5(self):
        genome = 'CCGGGT'
        expected = [2]
        output = minSkew.MinimumSkew(genome)
        self.assertEqual(output, expected)

    # check if more than one index is returned,
    def test_example6(self):
        genome = 'CCGGGT'
        expected = [2]
        output = minSkew.MinimumSkew(genome)
        self.assertEqual(output, expected)

if __name__ == '__main__':
    unittest.main()

